Console.WriteLine(MaxVowels("abciiidef",3));
Console.WriteLine(MaxVowels("aeiou", 2));
Console.WriteLine(MaxVowels("leetcode", 3));
Console.WriteLine(MaxVowels("", 50436));

static int MaxVowels(string s, int k)
{
    int left = 0; int right = k;
    int maxVowels = 0, countVowels = 0;
    for(int i=0;i<k; i++)
    {
        if(isVowels(s[i]))        
        {
            countVowels++;            
        }
    }
    maxVowels = countVowels;
    while(right < s.Length)
    {        
        if(isVowels(s[left]))
        {
            countVowels--;
        }
        if(isVowels(s[right]))
        {
            countVowels++;
        }
        if(countVowels > maxVowels)
        {
            maxVowels = countVowels;
        }
        right++;
        left++;

    }
    return maxVowels;
}

static bool isVowels(char t)
{
    if(t == 'a' || t == 'e' || t == 'i' || t == 'o' || t == 'u')
        return true;
    return false;
}